var EventRegistrar = {
    registerHandlers: function(object, handlers){
        $.each(handlers, function (k, v) {
            if (v.hasOwnProperty("element")) {
                $(v.element).on(v.event, v.selector, object[v.handler]);
            } else {
                $(v.selector).on(v.event, object[v.handler]);
            }
        });
    }
};

var Checkbox = {
    selector: null,
    init: function (selector, option) {
        Checkbox.selector = selector;
        EventRegistrar.registerHandlers(this, [{
            element: selector,
            selector: '.ev-checkbox-container',
            event: 'click',
            handler: 'handleMultipleInsertSelection'
        }]);

        Checkbox.preselectOption(option);
    },
    preselectOption: function (option) {
        var ckbox = $(Checkbox.selector).find('input[name="multiple[' + option + ']"]');
        ckbox.parent().addClass('default-day');
        ckbox.attr("checked", true);
    },
    resetOptions: function (preselectOption) {
        $(Checkbox.selector).find('.ev-checkbox-container').each(function (index, value) {
            $(value).removeClass('default-day').removeClass('selected');
            $(value).find('input[type="checkbox"]').attr('checked', false);
        });
        Checkbox.preselectOption(preselectOption);
    },
    handleMultipleInsertSelection: function () {
        if (!$(this).hasClass("default-day")) {
            $(this).toggleClass("selected");
            let ckbox = $(this).find("input[type='checkbox']")
            ckbox.attr("checked", !ckbox.attr("checked"));
        }
    }
};
var LocationManager = {
    location: 0,
    store: function () {
        LocationManager.location = $(window).scrollTop();
    },
    scrollToPreviousLocation: function () {
        LocationManager.scrollToPoint(LocationManager.location, 300)
    },
    scrollToSelector: function (selector) {
        LocationManager.scrollToPoint($(selector).offset().top, 700)
    },
    scrollToPoint: function(point, delay){
        $('html, body').animate({
            scrollTop: point
        }, delay);
    }
};

var Evexis = {
    init: function () {
    },
    getUrlFragment: function () {
        return window.location.hash.substr(1);
    },
    getCookie: function (name) {
        name = name + "=";
        var decodedCookie = decodeURIComponent(document.cookie);
        var ca = decodedCookie.split(';');
        for (var i = 0; i < ca.length; i++) {
            var c = ca[i];
            while (c.charAt(0) == ' ') {
                c = c.substring(1);
            }
            if (c.indexOf(name) == 0) {
                return c.substring(name.length, c.length);
            }
        }
        return "";
    },
    setCookie: function (name, value, expirationDays) {
        var d = new Date();
        d.setTime(d.getTime() + (expirationDays * 24 * 60 * 60 * 1000));
        var expires = "expires=" + d.toUTCString();
        document.cookie = name + "=" + value + ";" + expires + ";path=/";
    }
};

$(function () {
    Evexis.init();
});
